import React, { Component } from 'react';
import {
  Switch,
  Route
} from "react-router-dom";
import App from './App'
import Update from './Member/Update'
import AddNew from './Product/AddNew';


class Index extends Component {
  render () {
    return (
      <App>
        <Switch>
          <Route path='/account/member' component={Update} />
          <Route path='/account/addproduct' component={AddNew} />
          {/* <Route path='/account/product/list' component={Product} />
          <Route path='/account/product/add-edit/:id?' component={AddEdit} /> */}
        </Switch>
      </App>
    )
  }
}
export default Index
